require.config({"config": {
        "text":{"Magento_InventoryInStorePickupFrontend/template/store-selector/popup.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div id=\"store-selector-popup\">\n    <div class=\"block block-search store-selector-search\">\n        <div class=\"field search\">\n            <label class=\"label\" for=\"store-selector-search-input\">\n                <translate args=\"'Search'\"></translate>\n            </label>\n            <div class=\"control\">\n                <input id=\"store-selector-search-input\"\n                       type=\"text\"\n                       name=\"store-selector-search-query\"\n                       class=\"input-text\"\n                       maxlength=\"128\"\n                       textInput=\"searchQuery\"\n                       attr=\"placeholder: $t('Search with postcode or city name...')\"\n                />\n            </div>\n        </div>\n        <div class=\"actions\">\n            <button type=\"submit\"\n                    title=\"Search\"\n                    class=\"action search\"\n                    aria-label=\"Search\"\n            >\n                <translate args=\"'Search'\"></translate>\n            </button>\n        </div>\n    </div>\n    <p class=\"store-selector-popup-no-locations\" if=\"searchQuery() && nearbyLocations() && !nearbyLocations().length\">\n        <translate args=\"'We were unable to find nearby locations for provided search query.'\"></translate>\n    </p>\n    <p class=\"store-selector-popup-empty-query\" ifnot=\"searchQuery()\">\n        <translate args=\"'Please provide postcode or city name to find nearest pickup locations.'\"></translate>\n    </p>\n    <table class=\"store-selector-popup-table\" data-bind=\"blockLoader: isLoading, visible: nearbyLocations() && nearbyLocations().length\">\n        <thead>\n            <tr class=\"row\">\n                <th class=\"col col-method\" translate=\"'Location Details'\"></th>\n                <th class=\"col col-carrier\" translate=\"'Action'\"></th>\n            </tr>\n        </thead>\n        <tbody>\n            <!-- ko foreach: { data: nearbyLocations(), as: 'location' } -->\n                <!-- ko template: { name: $parent.storeSelectorPopupItemTemplate } --><!-- /ko -->\n            <!-- /ko -->\n        </tbody>\n    </table>\n</div>\n"}
}});
